    "2015-11-10T01:41:32.074086",nt"name": "time-averaged-currents-in-the-northeast-corridor-reserve-during-november-2013",nt"isopen":
    false,nt"url": null,nt"notes": "A 2D numerical model, CMS-Flow, was implemented
    for the Northeast Corridor Reserve (NECR) using a telescoping grid. Tide and wind
    forcing was provided to the model and the model was validated using water level
    data from the Fajardo NOAA NOS tide gauge and with current data from the CariCOOS
    Buoy in Vieques sound. The model was run from November 1-30, 2013 and the currents
    were averaged in time in order to determine the spatial distribution of the time-averaged
    current field within the NECR. All dates and times are UTC. Current speeds are in
    meters per second.",nt"license_title": null,nt"extras": [{ntt"key":
